
var Tx     = require('ethereumjs-tx').Transaction
const Web3 = require('web3')
const web3 = new Web3('HTTP://127.0.0.1:7545')

const privateKey1 = Buffer.from('8794492f052a59a00de0c2ec6dd04178319c2cbcc7247f03c6425b121f208c44', 'hex')
const account1 = '0x830320e2522c820cc59491ac4bF731F39f0E7052' 

//OMG,TETHER,USDC,WBTC,CHAIN,UNISWAP,ENJIN,DAI,MATIC
const contractsERC20= [
  //OMG
  '',
  //TETHER
  '',
//USDC
  '',
//WBTC
  '',
//CHAIN
  '',
//UNISWAP
  '',
//ENJIN
  '',
//DAI
  '',
//MATIC
'', 
]

//data = contractsERC20[0]
data = contractsERC20[9]


// Deploy the contract
web3.eth.getTransactionCount(account1, (err, txCount) => {
  const txObject = {
    nonce:    web3.utils.toHex(txCount),
    gasLimit: web3.utils.toHex(1000000000), // Raise the gas limit to a much higher amount
    gasPrice: web3.utils.toHex(web3.utils.toWei('1', 'gwei')),
    data: data
  }

  const tx = new Tx(txObject)
  tx.sign(privateKey1)

  const serializedTx = tx.serialize()
  const raw = '0x' + serializedTx.toString('hex')

  web3.eth.sendSignedTransaction(raw, (err, txHash) => {
    console.log('err:', err, 'txHash:', txHash)
    // Use this txHash to find the contract on Etherscan!
  })
})


